import React from 'react';
import styled from "styled-components";
import {FlexWrapper} from "../../../components/FlexWrapper";
import photo from '../../../assets/img/photo1.webp'
import elips from '../../../assets/img/main/Ellipse_main.png'
import {Container} from "../../../components/Container";

export const Main = () => {
    return (
        <StyledMain>
            <Container>
                <FlexWrapper justify='space-between'>
                    <FlexWrapper direction='column'>
                        <Hello>HELLO</Hello>
                        <Name>Ninja</Name>
                        <AboutMain>I've been doing web design, front-end and back-end development for a year now. Do you
                            need a
                            website design, site layout, or maybe a turnkey website? Then contact me</AboutMain>
                        <MainButton>Contact me</MainButton>
                    </FlexWrapper>
                    <FlexWrapper>
                        <ElipsContainer>
                            <ElipsWrapper>
                                <Elips src={elips}></Elips>
                            </ElipsWrapper>
                            <Photo src={photo} alt="it's me"/>
                        </ElipsContainer>
                    </FlexWrapper>
                </FlexWrapper>
            </Container>
        </StyledMain>
    );
};

const StyledMain = styled.section`
  display: flex;
  justify-content: space-between;
  max-height: 100vh;
  margin-top: 100px;
  //background: linear-gradient(45deg, #2d2d2d 100%, #000000);
  //box-shadow: 0 4px 4px 0 rgba(0, 0, 0, 0.25);
`

const Hello = styled.span`
  font-weight: 600;
  font-size: 48px;
`

const Name = styled.h2`
  font-weight: 700;
  font-size: 72px;
  margin: 27px 0;
`

const AboutMain = styled.h1`

`

const MainButton = styled.a`
  width: 200px;
  height: 60px;
  background-color: #E2A300;
`

const Photo = styled.img`
  position: relative;
  width: 456px;
  height: 591px;
  bottom: 600px;
`
const ElipsContainer = styled.div`
  position: relative;
  width: 575px;
  height: 575px;
  //border: 1px solid red;
  
`

const ElipsWrapper = styled.div`
    position: absolute;
    /* поддерживаются любые единицы, в том числе проценты */
  margin: 1em auto;
  background: silver;
  border-radius: 20px;

  ::before {
    content: "";
    display: inline-block;
    vertical-align: middle;
    padding-top: 100%;
  }
`

const Elips = styled.img`
  position: relative;
  width: 575px;
  height: 575px;
  border-radius: 50%;
  box-shadow: 0 0 90px 0 rgba(0, 196, 240, 0.42);
  

`
